import { makeStyles } from '@material-ui/core/styles';

const styles = makeStyles({
    wrapper: {
        width: "65%",
        margin: "auto",
        textAlign: "left"
    },
    smallSpace:{
        marginTop: "1rem",
    },
    Normal: {
        width: "48px",
        height: "48px"
    },
    grid:{
        display: "flex",
        justifyContent: "left",
        alignItems: "left",
        flexWrap: "nowrap",
    }
})

export default styles;
